import React, { useState, useEffect } from 'react';
import { useCart } from '../../context/CartContext';
import { productAPI } from '../../services/api';
import './ProductPages.css';

const CurrencyNotes = () => {
  const [products, setProducts] = useState([]);
  const [loading, setLoading] = useState(true);
  const { addToCart } = useCart();

  // Fallback data if API fails
  const fallbackNotes = [
    { id: 1, name: '‚Çπ1 Currency Note', price: 50, description: 'Special serial number ‚Çπ1 note', image: '/assets/Currency_notes/1.jpg', type: 'currency_note' },
    { id: 2, name: '‚Çπ5 Currency Note', price: 75, description: 'Special serial number ‚Çπ5 note', image: '/assets/Currency_notes/5.jpeg', type: 'currency_note' },
    { id: 3, name: '‚Çπ10 Currency Note', price: 100, description: 'Special serial number ‚Çπ10 note', image: '/assets/Currency_notes/10.jpg', type: 'currency_note' },
    { id: 4, name: '‚Çπ20 Currency Note', price: 150, description: 'Special serial number ‚Çπ20 note', image: '/assets/Currency_notes/20.jpg', type: 'currency_note' },
    { id: 5, name: '‚Çπ50 Currency Note', price: 200, description: 'Special serial number ‚Çπ50 note', image: '/assets/Currency_notes/50.jpg', type: 'currency_note' },
    { id: 6, name: '‚Çπ100 Currency Note', price: 300, description: 'Special serial number ‚Çπ100 note', image: '/assets/Currency_notes/100.jpg', type: 'currency_note' },
    { id: 7, name: '‚Çπ200 Currency Note', price: 500, description: 'Special serial number ‚Çπ200 note', image: '/assets/Currency_notes/200.jpg', type: 'currency_note' },
    { id: 8, name: '‚Çπ500 Currency Note', price: 800, description: 'Special serial number ‚Çπ500 note', image: '/assets/Currency_notes/500.jpg', type: 'currency_note' }
  ];

  useEffect(() => {
    fetchProducts();
  }, []);

  const fetchProducts = async () => {
    try {
      const response = await productAPI.getByType('currency_note');
      setProducts(response.products || []);
    } catch (error) {
      console.error('Error fetching currency notes:', error);
      // Use fallback data if API fails
      setProducts(fallbackNotes);
    } finally {
      setLoading(false);
    }
  };

  const handleAddToCart = (product) => {
    addToCart(product, 1);
  };

  if (loading) {
    return (
      <div className="product-page">
        <div className="container">
          <div className="loading-spinner">Loading currency notes...</div>
        </div>
      </div>
    );
  }

  return (
    <div className="product-page">
      <div className="container">
        <div className="page-header">
          <h1 className="page-title">Currency Notes</h1>
          <p className="page-subtitle">
            Special serial number currency notes perfect for gifting on birthdays, anniversaries, and special occasions
          </p>
        </div>

        <div className="products-grid">
          {products.map((product) => (
            <div key={product.id} className="product-card">
              <div className="product-image">
                <img 
                  src={product.image || product.imageUrl || '/assets/Currency_notes/default.jpg'} 
                  alt={product.name} 
                  style={{height: '100px', width: 'auto', borderRadius: '6px', boxShadow: '0 2px 8px rgba(0,0,0,0.08)'}} 
                  onError={(e) => {
                    e.target.src = '/assets/Currency_notes/1.jpg'; // fallback image
                  }}
                />
              </div>

              <div className="product-info">
                <h3 className="product-name">{product.name}</h3>
                <p className="product-description">{product.description}</p>
                <div className="product-price">‚Çπ{product.price}</div>

                {product.stock > 0 ? (
                  <button 
                    onClick={() => handleAddToCart(product)}
                    className="btn btn-primary add-to-cart-btn"
                  >
                    Add to Cart
                  </button>
                ) : (
                  <button 
                    className="btn btn-secondary add-to-cart-btn" 
                    disabled
                  >
                    Out of Stock
                  </button>
                )}
              </div>
            </div>
          ))}
        </div>

        <div className="product-info-section">
          <h2>About Our Currency Notes</h2>
          <div className="info-grid">
            <div className="info-item">
              <h3>üéØ Special Serial Numbers</h3>
              <p>We carefully select currency notes with serial numbers matching special dates like birthdays, anniversaries, or lucky numbers.</p>
            </div>
            <div className="info-item">
              <h3>‚ú® Authentic & Genuine</h3>
              <p>All our currency notes are authentic and in excellent condition, perfect for gifting and collecting.</p>
            </div>
            <div className="info-item">
              <h3>üéÅ Perfect Gifts</h3>
              <p>Unique and meaningful gifts that create lasting memories for your loved ones.</p>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default CurrencyNotes;
